import React, { useState } from "react";
import TaglineAdmin from "./dashboard/TaglineAdmin";
import Navbar from "./dashboard/Navbar";
import IntroAdmin from "./dashboard/IntroAdmin";
import StageAdmin from "./dashboard/StageAdmin";
import ServiceAdmin from "./dashboard/ServiceAdmin";
import DetailAdmin from "./dashboard/DetailAdmin";
import TeamAdmin from "./dashboard/TeamAdmin";
import AboutAdmin from "./dashboard/AboutAdmin";
import ContactAdmin from "./dashboard/ContactAdmin";
import { useHistory } from "react-router-dom";
import { signin, signup } from "../Api";
const Homeadmin = () => {
  const history = useHistory();
  const [islooggerin, setIslooggerin] = useState(true);
  const [auth, setAuth] = useState({
    email: "",
    password: "",
  });

  const handelSubmit = async (e) => {
    const tdata = await axios.post(url, { email: email, password: password });
    const { token, user } = tdata.data;
    dispatch(loggingin(user.email, token, user.name));
    localStorage.setItem("jwt", token);
    localStorage.setItem("user", JSON.stringify(user));
    M.toast({
      html: "signedin successfully",
      classes: "#43a047 green darken-1",
    });
    history.push("/");
  };

  return islooggerin ? (
    <div className="homeAdmin">
      <Navbar />
      <TaglineAdmin />
      <IntroAdmin />
      <StageAdmin />
      <ServiceAdmin />
      <DetailAdmin />
      <TeamAdmin />
      <AboutAdmin />
      <ContactAdmin />
    </div>
  ) : (
    <div className="container container_login">
      <form className="form-signin">
        <h1 className="h3 mb-3 font-weight-normal">Please sign in</h1>
        <label htmlFor="inputEmail" className="sr-only">
          Email address
        </label>
        <input
          type="email"
          id="inputEmail"
          className="form-control"
          placeholder="Email address"
          required
          autofocus
        />
        <label htmlFor="inputPassword" className="sr-only">
          Password
        </label>
        <input
          type="password"
          id="inputPassword"
          className="form-control"
          placeholder="Password"
          required
        />
        <button className="btn btn-lg btn-primary btn-block" type="submit">
          Sign in
        </button>
      </form>
    </div>
  );
};

export default Homeadmin;
